import { createStore } from "vuex";

export default createStore({
  state: {
    username: "jnhjhjn",
    token: null,
  },
  getters: {},
  mutations: {
    setSession(username, token) {
      this.username = username;
      this.token = token;

    },
  },
  actions: {},
  modules: {},
});
